import Navbar from '../navSection/Navbar';
import Map from '../component/Map';

function HomePage() {
  return (
    <div>
      <Navbar />
      <Map />
      <div>
        {' '}
        <h3>We diliver to your door-step</h3>
      </div>
    </div>
  );
}

export default HomePage;
